import './App.css';
import Expenses  from './Expenses';
// import 

let App = () => {

  let expenses = [
    {
      id: 1,
      title: "School Fee",
      amount: 1000,
      date: new Date()
    },
    {
      id: 2,
      title: "Books",
      amount: 200,
      date: new Date()
    },
    {
      id: 3,
      title: "Food",
      amount: 100,
      date: new Date()
    },
    {
      id: 4,
      title: "Tuition",
      amount: 1200,
      date: new Date()
    }
  ];
  return (
    <Expenses
    title={expenses[0].amount}
    />

  );
}
export default App;
